





drop table if exists UserConnection;
create table UserConnection (userId varchar(255) not null, providerId varchar(255) not null, providerUserId varchar(255), rank int not null, displayName varchar(255), profileUrl varchar(512), imageUrl varchar(512), accessToken varchar(1024) not null, secret varchar(255), refreshToken varchar(255), expireTime bigint, primary key (userId, providerId, providerUserId));
create unique index UserConnectionRank on UserConnection(userId, providerId, rank);








CREATE FUNCTION rating_avg() RETURNS trigger AS $raiting_trig$ DECLARE ser real;BEGIN ser := regr_avgx(id, rating) FROM (SELECT * FROM feedback WHERE apartment_id = NEW.apartment_id AND enabled = true) AS foo; UPDATE apartments SET raiting = ser WHERE id = NEW.apartment_id; RETURN NULL; END;$raiting_trig$ LANGUAGE plpgsql;
CREATE TRIGGER raiting_trig AFTER INSERT ON feedback FOR EACH ROW EXECUTE PROCEDURE rating_avg();
CREATE TRIGGER raiting_trig_upt AFTER UPDATE ON feedback FOR EACH ROW EXECUTE PROCEDURE rating_avg();
